// src/pages/Profile.js
import React from 'react';

const Profile = () => {
    // Replace with actual user data fetched from the backend or context
    const user = {
        name: 'Jane Doe',
        email: 'jane.doe@example.com',
        events: [
            { id: 1, title: 'Kigali Jazz Night', date: '2024-09-01' },
            { id: 2, title: 'Rwanda Music Festival', date: '2024-10-10' },
        ],
    };

    return (
        <div className="profile-container">
            <h2>{user.name}'s Profile</h2>
            <p>Email: {user.email}</p>
            <h3>My Events</h3>
            <ul>
                {user.events.map(event => (
                    <li key={event.id}>
                        {event.title} - {event.date}
                    </li>
                ))}
            </ul>
            <button>Logout</button>
        </div>
    );
};

export default Profile;
